const contactStyle = {
    // #FFAC62
    // #1E6F79
    container: {
        height: '100vh',
        backgroundColor: '#1E6F79'
    },
    titleContainer: {
        display: 'flex',
        paddingTop: '5vh',
        height: '10vh',
        alignItems: 'center',
        justifyContent: 'center',
        color: '#FFAC62',
    },
    address:{
        position: 'absolute',
        marginTop:'40vh',
        height: '10vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
    },
    homeIcon:{
        height: '5vh'
    }
};

export default contactStyle;
